import React from 'react';
import logo from './logo.svg';
import './App.css';
import Hello from './componenets/hello';
import Header from './componenets/header';

function App() {
  return (
    <div className="header">
      <Header/>
      <div className="container">
        <Hello/>
      </div>
    </div>
  );
}




export default App;
